import React, { useState, useEffect } from "react";
import "../../index.css";
import { Link } from "react-router-dom";

export default class UserList extends React.Component{
    state = {
        course : []
    };


    async componentDidMount() {
            const res = await fetch("https://reqres.in/api/users/");
            const course = await res.json();
            this.setState({
                course
            });
    }

    render() {
        return(
        <section class="py-5 bg-light">
          <div class="container px-5 my-5">
            <div class="text-center mb-5">
              <h1 class="fw-bolder">List User</h1>
            </div>

            <div class="row gx-5 content-center">
              {this.state.course.map(item => (
                    <div key={item.id} class="col-xl-4 mb-5">
                      <Link to={`/course/${item.id}`} className="text-reset text-decoration-none">
                        <div class="card mb-5 mb-xl-0">
                          <div class="card-body p-5">
                            <div class="mb-3 text-center">
                              <span class="fw-bolder"><img src={item.avatar} /></span>
                            </div>
                            <div class="text-center">
                              <span>{item.first_name}</span>
                              <p>{item.email}</p>
                            </div>
                          </div>
                        </div>
                      </Link>
                    </div>
                  ))}
            </div>

          </div>
        </section>
       );
    }
}
